const httpJsonConnection = async (url, body, resSuc, resFail) => {
    let plusParamsUrl = url + '?';
    
    console.log('cccc',plusParamsUrl);
    
    
    let json = await fetch(plusParamsUrl, {
      method: 'POST',
      body,
      headers:{
        'Authorization' : 'Bearer'
      }
    })
      .then(res => res.json())
      .catch(err => alert(`${err}`));
      resSuc(json);

   return json;
  };
  
